import React, { Component } from "react";

import AppHeader from "./components/appHeader";
import "./App.scss";
import { Switch, Route } from "react-router-dom";
import AppContainer from "./components/appContainer";

class App extends Component {
  state = {
    header: {
      brandName: "HINT",
    },
    products: [
      {
        _id: 1,
        title: "Email Wizard",
        content: "",
      },
      {
        _id: 2,
        title: "Document Digitization",
        content: "",
      },
      {
        _id: 3,
        title: "Rules Extraction",
        content: "",
      },
      {
        _id: 4,
        title: "Libor",
        content: "",
      },
      {
        _id: 5,
        title: "Email Wizard",
        content: "",
      },
      {
        _id: 6,
        title: "Email Wizard",
        content: "",
      },
    ],
  };

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <AppHeader header={this.state.header} />
        </header>
        <section className="main-router-container">
          <Switch>
            <Route to="/" exact component={AppContainer} />
          </Switch>
        </section>
      </div>
    );
  }
}

export default App;
